import styled from 'styled-components';
import Bg from './img/Bg.jpg';

export const Outbox = styled.div`
    /* background: url(${Bg});
    background-size: auto 100%; */
    background-color: rgb(0, 42, 97);
    text-align: center;
    width: 100vw;
    height: 100vh;
    margin: 0 auto;

    color: white;


    @media screen and (min-width: 500px) {
        width: 500px;
    }
`
